window.bookSummaryJSON = "<p>Money is my mistress.</p> <p>Solving problems, my trade.</p> <p>Until the tables turn, and trouble finds me.</p> <p>Now on the run, I need a plan.</p> <p>But not before I’m blindsided by a pain-in-the-ass stranger.</p> <p>Maggie.</p> <p>Curves, startling blue eyes, and she hates me.</p> <p>I don’t trust her, and with good reason.</p> <p>My plan is simple: use her.</p> <p>Then I kiss her. Touch her. Crave her.</p> <p>She was my way out; now she’s my downfall.</p> <p><b><i>Prophet </i></b><b>is a full-length, stand-alone enemies-to-lovers romance with an HEA.</b></p>"; 
